import "../../css/pages/loginPage.css";
import { useAttemptSignup } from "../../hooks/user/useAttemptSignup";
export const SignupPage = () => {
  const { email, password, setEmail, setPassword, handleAttemptSignup } =
    useAttemptSignup();
  return (
    <section>
      <input
        value={email}
        type="email"
        placeholder="Input Email Address"
        onChange={({ target: { value } }) => setEmail(value)}
      />
      <input
        value={password}
        type="password"
        placeholder="Input Password"
        onChange={({ target: { value } }) => setPassword(value)}
      />
      <button onClick={handleAttemptSignup}>Login</button>
      {/* <a href={handleAttemptSignup()}>GITHUB LOGIN</a> */}
    </section>
  );
};
